import { Outlet, Link } from "react-router-dom";
import { AppBar, Toolbar, Typography, Button, Menu, MenuItem, TextField } from '@mui/material';

const Layout = () => {
   return (
     <>
      <AppBar position="static">
          <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            Trade Activities
          </Typography>
          <Button color="inherit" onClick={handleClick}>
            Menu
          </Button>
          <Menu
            anchorEl={anchorEl}
            open={Boolean(anchorEl)}
            onClose={handleClose}
            anchorOrigin={{
              vertical: 'top',
              horizontal: 'right',
            }}
            transformOrigin={{
              vertical: 'top',
              horizontal: 'right',
            }}
          >
            <MenuItem onClick={<Link to="/">Home</Link>}>Home</MenuItem>
            <MenuItem onClick={<Link to="/open-positions"></Link>}>Open Positions</MenuItem>
            <MenuItem onClick={<Link to="/test2">Test2</Link>}>Page 2</MenuItem>
          </Menu>
            
          </Toolbar>
        </AppBar>
       <Outlet />
     </>
   )
};

export default Layout;
